def parse_cpp_matrix_to_mpmath(cpp_matrix_str, rows, cols):
    """
    Parses a C++ matrix string representation into an mpmath matrix with complex numbers.

    Parameters:
    - cpp_matrix_str: str, the C++ string representation of a matrix.
    - rows: int, number of rows in the matrix.
    - cols: int, number of columns in the matrix.

    Returns:
    - An mpmath matrix with complex numbers.
    """
    # Extract the numerical part of the string (assuming the format is consistent with the example given)
    numbers_str = cpp_matrix_str.split('{')[1].split('}')[0]
    # Split the string into individual numbers, handling real and imaginary parts
    numbers_str_list = numbers_str.replace("\n", "").replace("\\", "").split(',')
    # Remove 'q' and strip whitespace, then convert each to mpmath float
    numbers = [num.replace('q', '').strip() for num in numbers_str_list if num.strip()]

    # Construct the mpmath matrix
    mpmath_matrix = mp.matrix(rows, cols)
    for i in range(rows):
        for j in range(cols):
            # Extract the real and imaginary parts
            real_part = mp.mpf(numbers[(i * cols + j) * 2])
            imaginary_part = mp.mpf(numbers[(i * cols + j) * 2 + 1])
            # Assign the complex number to the matrix
            mpmath_matrix[i, j] = mp.mpc(real_part, imaginary_part)

    return mpmath_matrix
