# Test function generator
def f(x, k):
    return np.sin(k * np.pi * x)
# Define the mapping function
def mapping(x, alpha):
    return sin(alpha * pi * x / 2) / sin(alpha * pi / 2)

# Define the function to compute weights μm
def compute_weights(zm, alpha):
    mu = np.zeros(len(zm))
    for n in range(len(zm)):
        if n == 0:
            mu[n] = (1/2) * (arcsin(mapping(zm[n+1], alpha)) - arcsin(mapping(zm[n], alpha)))
        elif n == len(zm) - 1:
            mu[n] = (1/2) * (arcsin(mapping(zm[n], alpha)) - arcsin(mapping(zm[n-1], alpha)))
        else:
            mu[n] = (1/2) * (arcsin(mapping(zm[n+1], alpha)) - arcsin(mapping(zm[n-1], alpha)))
    return mu

# Define the basis functions φn(x)
def phi_n(x, n, alpha):
    cn = sqrt(1/pi) if n == 0 else sqrt(2/pi)
    return cn * cos(n * np.arccos(mapping(x, alpha)))

# Function to create the MPA expansion matrix
def create_expansion_matrix(alpha, M, N):
    # Create the grid points zm
    zm = np.linspace(-1, 1, M)

    # Compute the weights μm
    mu = compute_weights(zm, alpha)
    sqrt_mu = np.sqrt(mu)

    # Create the matrix A
    A = np.zeros((M, N))
    for m in range(M):
        for n in range(N):
            A[m, n] = sqrt_mu[m] * phi_n(zm[m], n, alpha)

    # Compute the SVD of A
    U, s, Vh = svd(A, full_matrices=False)

    # Construct the expansion matrix
    expansion_matrix = np.dot(Vh.T, np.dot(np.diag(1/s), np.dot(U.T, np.diag(sqrt_mu))))

    return expansion_matrix

# Function to create the interpolation matrix
def create_interpolation_matrix(alpha, M, N, N_interpolated):
    expansion_matrix = create_expansion_matrix(alpha, M, N)

    # Create the interpolation points
    z_interpolated = np.linspace(-1, 1, N_interpolated)

    # Create the matrix Phi for the interpolated points
    Phi_interpolated = np.zeros((N_interpolated, N+1))
    for i in range(N_interpolated):
        for n in range(N+1):
            Phi_interpolated[i, n] = phi_n(z_interpolated[i], n, alpha)

    interpolation_matrix = np.dot(Phi_interpolated, expansion_matrix)

    return interpolation_matrix

def parse_attributes_from_filename(filename):
    """
    Parse the attributes from the filename.

    Parameters:
    - filename: str, the filename to parse.

    Returns:
    - A dictionary containing the parsed attributes.
    """
    pattern = r"alpha(?P<alpha>[0-9.]+)_order(?P<order>\d+)_ncoll(?P<ncoll>\d+)_next(?P<next>\d+)_nphys(?P<nphys>\d+)_nfourier(?P<nfourier>\d+)"
    match = re.search(pattern, filename)
    if match:
        return {
            'alpha': float(match.group('alpha')),
            'order': int(match.group('order')),
            'ncoll': int(match.group('ncoll')),
            'next': int(match.group('next')),
            'nphys': int(match.group('nphys')),
            'nfourier': int(match.group('nfourier')),
        }
    return None


# Function to compute the FFT of a periodic function and interpolate it on a given grid
def interpolate_using_fft(f_values, x, N_interpolated):
    # Compute the FFT of the input function
    f_fft = np.fft.fft(f_values)

    # Create the new grid for interpolation
    x_interpolated = np.linspace(-1, 1, N_interpolated, endpoint=False)

    # Zero-pad the FFT coefficients to the desired length for interpolation
    f_fft_padded = np.zeros(N_interpolated, dtype=complex)
    M = len(f_fft)
    f_fft_padded[:M//2] = f_fft[:M//2]
    f_fft_padded[-M//2:] = f_fft[-M//2:]

    # Compute the inverse FFT on the padded FFT coefficients
    f_interpolated = np.fft.ifft(f_fft_padded) * N_interpolated / M

    return x_interpolated, f_interpolated

